INSERT INTO `p8_label` (`id`,`system`,`module`,`site`,`env`,`source_system`,`source_module`,`name`,`type`,`option`,`content`,`invoke`,`variable`,`timestamp`,`last_update`,`ttl`,`postfix`,`update_time`,`last_setter`) VALUES ('16608','cms','item','','','','','list_introduction_con1','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"60\";s:19:\"place_holder_height\";s:2:\"20\";}','<p>中国国际海运集装箱（集团）股份有限公司（简称：中集集团），是世界领先的物流装备和能源装备供应商，总部位于中国深圳。公司致力于在如下主要业务领域：集装箱、道路运输车辆、能源化工及食品装备、海洋工程、物流服务、空港设备等，提供高品质与可信赖的装备和服务。支持这些业务蓬勃发展的有：提供专业资金管理的财务公司，以及提供金融解决方案的融资租赁公司。作为一家为全球市场服务的多元化跨国产业集团，中集在亚洲、北美、欧洲、澳洲等地区拥有300余家成员企业及3家上市公司，客户和销售网络分布在全球100多个国家和地区。2016年，5万优秀的中集员工，创造了511.12亿元的销售业绩，净利润约5.4亿元。</p>\r\n\r\n<p>中国国际海运集装箱（集团）股份有限公司（简称：中集集团），是世界领先的物流装备和能源装备供应商，总部位于中国深圳。公司致力于在如下主要业务领域：集装箱、道路运输车辆、能源化工及食品装备、海洋工程、物流服务、空港设备等，提供高品质与可信赖的装备和服务。支持这些业务蓬勃发展的有：提供专业资金管理的财务公司，以及提供金融解决方案的融资租赁公司。作为一家为全球市场服务的多元化跨国产业集团，中集在亚洲、北美、欧洲、澳洲等地区拥有300余家成员企业及3家上市公司，客户和销售网络分布在全球100多个国家和地区。2016年，5万优秀的中集员工，创造了511.12亿元的销售业绩，净利润约5.4亿元。</p>\r\n\r\n<p>中集集团于1980年1月创立于深圳，由招商局与丹麦宝隆洋行合资成立，初期由宝隆洋行派员管理。1994年公司在深圳证券交易所上市，2012年12月在香港联交所上市，目前是A+H股公众上市公司，主要股东为招商局集团、中国远洋海运集团和弘毅投资等。诞生时即深深植入的国际化基因，出类拔萃的公司治理结构，长期以来对于技术创新和管理效率的不懈追求，使得中集快速成长为在全球多个行业具有领先地位的企业。</p>','$label[list_introduction_con1]','0','1509089610','1673943524','300','','1509089610','');
