INSERT INTO `p8_label` (`id`,`system`,`module`,`site`,`env`,`source_system`,`source_module`,`name`,`type`,`option`,`content`,`invoke`,`variable`,`timestamp`,`last_update`,`ttl`,`postfix`,`update_time`,`last_setter`) VALUES ('16610','cms','item','','mobile','','','group_mobile_about_con1','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"58\";s:19:\"place_holder_height\";s:2:\"17\";}','<p>美式新古典风格是将古典风范与现代精神结合起来使古典家具呈现出多姿多彩的面貌。邂逅美式新古典情调没有太多造作的修饰与约束，这些元素也正好迎合了时下的文化资产者对生活的一种需求，“她”为人们提供的不态，平和而富有内涵的气韵族之身份。</p>','$label[group_mobile_about_con1]','0','1509089689','1583331403','300','','1509089689','');
