INSERT INTO `p8_opinion_data` (`id`,`iid`,`uid`,`name`,`tel`,`mobile`,`ip`,`accept`,`accept_desc`,`up`,`down`,`timestamp`,`status`,`title`,`content`,`email`) VALUES ('3','1','1','23423423','','234234','121.8.204.243','0','','0','0','1378739124','0','23423','过去一周，中国各地大学迎来新生报到潮。前日是武汉华中师范大学新生入学首日，学校在该校体育馆内为新生家长们提供免费住宿。当晚有400多名学生家长在体育馆打地铺过夜。这是该校连续第8年在新生开学报到时为家长提供免费住宿。中国大学新生大部分都和家长一起到学校报到的。至于原因有多方面，但主要是家长不放心孩子第一次出门。为了安置这些家长，不少大学必须预订学校周围宾馆，并免费为他们准备帐篷或在校内打地铺。','');
